// import GetFetch from "./components/fetch/GetFetch";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import FeaturedImages from "./components/fetch/FeaturedImages";
import ImageInfo from "./components/fetch/ImageInfo";

function App() {
  return (
    <Router>
      <div>
        <Routes>
          <Route exact path="/" element={<FeaturedImages />} />
          <Route exact path="/ImageInfo/:id" element={<ImageInfo />} />
          {/* <Route exact path="/product/:id" component={FeaturedImages} />
          <Route exact path="/image/:id" component={ImageInfo} /> */}
        </Routes>
      </div>
    </Router>
    // <div>
    //   <div>
    //     <GetFetch />
    //   </div>
    // </div>
  );
}

export default App;
